import React, { useEffect, useState } from "react";
import './App.css';
import { createBrowserRouter, RouterProvider } from "react-router-dom";
import {HomeLayout,Landing, MondayCard , Main, UserContext} from "./pages"
const router = createBrowserRouter([
  {
    path: "/",
    element: <HomeLayout />,
    // errorElement: <Error />,
    children: [
      {
        index: true,
        element: <Landing />,
      },
      {
        path: "mondaycard",
        element: <MondayCard />,
      },
      {
        path: "main",
        element: <Main />,
      },

    ],
  },
]);

function App() {

  return (

    <UserContext>
    <RouterProvider router={router} />
    </UserContext>

  );
};
export default App;
